import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import "../about.css";

const About = () => {
  return (
    <div className="about">
      {/* TODO: mission section */}
      {/* TODO: 3D award graphic */}
      {/* TODO: land acknowledgement */}
      {/* TODO: FAQ */}
      <Container>
        <Row>
          <Col>
            <h2>About UC Berkeley SWE</h2>
            <header class="masthead">
              <div class="gradient"></div>
              <div class="graphics fadeIn"></div>
              <div class="container">
                <div class="row">
                  <div class="col-lg-10 col-md-10 mx-auto">
                    <div class="site-heading">
                      <h1><div class="fadeIn">Aspire. Advance. Achieve.</div></h1>
                      <span class="subheading"><div class="fadeInAfter">Society of Women Engineers is a national nonprofit organization which strives to highlight the achievements of non-male individuals as leaders and engineers.
                      </div></span>
                      <div class="clearfix">
                        <div class="fadeInAfter"><a class="btn btn-primary" href="involved">Get Involved</a></div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </header>
            <p>Content goes here</p>
            </Col>
        </Row>
      </Container>
    </div>
  );
}

export default About;
